import React, { useState, useEffect } from 'react';

const PipelineMonitor = () => {
  const [pipelines, setPipelines] = useState([]);
  const [lastPoll, setLastPoll] = useState(null);

  useEffect(() => {
    fetchPipelineData();
    // Polling every 5 seconds
    const interval = setInterval(fetchPipelineData, 5000);
    return () => clearInterval(interval);
  }, []);

  const fetchPipelineData = () => {
    // Mock Data with slight randomization to simulate movement
    const mockPipelines = [
      {
        id: 101, name: 'Backend-CI', status: 'running', branch: 'main', commit: 'a1b2c3d',
        stages: [
          { name: 'Build', status: 'success' },
          { name: 'Test', status: 'success' },
          { name: 'Security Scan', status: 'running' },
          { name: 'Deploy', status: 'pending' }
        ]
      },
      {
        id: 102, name: 'Frontend-Deploy', status: 'failed', branch: 'feat/ui-update', commit: '9876543',
        stages: [
          { name: 'Build', status: 'success' },
          { name: 'Lint', status: 'failed' },
          { name: 'Deploy', status: 'skipped' }
        ]
      },
      {
        id: 103, name: 'ML-Model-Train', status: 'success', branch: 'dev', commit: 'def456',
        stages: [
          { name: 'Data Prep', status: 'success' },
          { name: 'Train', status: 'success' },
          { name: 'Eval', status: 'success' }
        ]
      }
    ];
    setPipelines(mockPipelines);
    setLastPoll(new Date());
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'success': return '#22c55e';
      case 'failed': return '#ef4444';
      case 'running': return '#3b82f6';
      default: return '#64748b'; // Pending/Skipped
    }
  };

  // Helper to render a visual progress bar
  const renderProgressBar = (stages) => {
    const total = stages.length;
    return (
      <div style={{ display: 'flex', height: '8px', width: '100%', borderRadius: '4px', overflow: 'hidden', marginTop: '10px' }}>
        {stages.map((stage, idx) => (
          <div 
            key={idx} 
            title={`${stage.name}: ${stage.status}`}
            style={{ 
              flex: 1, 
              backgroundColor: getStatusColor(stage.status),
              borderRight: idx !== total -1 ? '1px solid #0f172a' : 'none'
            }} 
          />
        ))}
      </div>
    );
  };

  return (
    <div className="card pipeline-monitor">
      <div className="header" style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
        <h3>CI/CD Pipeline Monitor</h3>
        <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
          <span className="badge" style={{ display: 'flex', alignItems: 'center', gap: '5px' }}>
            <span style={{ height: '8px', width: '8px', background: '#22c55e', borderRadius: '50%', animation: 'pulse 2s infinite' }}></span>
            Live
          </span>
        </div>
      </div>

      <div className="pipelines-list" style={{ display: 'flex', flexDirection: 'column', gap: '15px' }}>
        {pipelines.map((p) => (
          <div key={p.id} style={{ background: '#0f172a', padding: '15px', borderRadius: '8px', borderLeft: `4px solid ${getStatusColor(p.status)}` }}>
            <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '5px' }}>
              <h4 style={{ margin: 0 }}>{p.name}</h4>
              <span style={{ color: getStatusColor(p.status), fontWeight: 'bold', textTransform: 'uppercase', fontSize: '0.8rem' }}>
                {p.status}
              </span>
            </div>

            <div style={{ fontSize: '0.85rem', color: '#94a3b8', display: 'flex', gap: '15px' }}>
              <span>ðŸŒ¿ {p.branch}</span>
              <span style={{ fontFamily: 'monospace' }}>ðŸ”— {p.commit}</span>
            </div>

            {/* Visual Progress Bar */}
            {renderProgressBar(p.stages)}

            <div style={{ display: 'flex', justifyContent: 'space-between', marginTop: '5px', fontSize: '0.75rem', color: '#64748b' }}>
              <span>Start: {p.stages[0].name}</span>
              <span>End: {p.stages[p.stages.length-1].name}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PipelineMonitor;
